import './App.css';
import React, { useRef } from 'react';
import NavBar from './NavBar/navBar'
import About from './About/about'
import Education from './Education/education'
import Experience from './Experience/experience';
import Publication from './Publication/publication'

function App() {
  const aboutRef = useRef(null);
  const experienceRef = useRef(null);
  const publicationRef = useRef(null);
  const educationRef = useRef(null);

  return (
    <div className="App" ref={ref}>
      <NavBar mainRef={{about: aboutRef, experience: experienceRef, publication: publicationRef, education: educationRef}} />
      <About ref={aboutRef} id="about"/>
      <Experience ref={experienceRef} id="experience"/>
      <Publication ref={publicationRef} id="publication"/>
      <Education ref={ref} id="education"/>
    </div>
  );
}

export default App;
